INSERT INTO entries (entry_id, glossary_id, translations, abbreviations, variants, raw_metadata) VALUES ('ba_org_gsc_defense_bureau', 3, '{"en": "GSC Defense Bureau", "zh-CN": "\u8054\u90a6\u5b66\u751f\u4f1a\u4fdd\u536b\u79d1", "ja": "\u9023\u90a6\u751f\u5f92\u4f1a\u9632\u885b\u5ba4", "ko": "\uc5f0\ubc29\ud559\uc0dd\ud68c \ubc29\uc704\uc2e4"}', '{}', '{}', '{"category": "organization", "part_of_speech": "Proper Noun", "remarks": "The department within the General Student Council responsible for issuing the SRT school closure order."}');
INSERT INTO entries (entry_id, glossary_id, translations, abbreviations, variants, raw_metadata) VALUES ('ba_character_bing_chan', 3, '{"en": "Bing-chan", "zh-CN": "\u997c\u9171", "ja": "\u30d1\u30f3\u30b1\u30fc\u30ad\u3061\u3083\u3093", "ko": "\ud32c\ucf00\uc774\ud06c\uc9f1"}', '{}', '{}', '{"category": "character", "part_of_speech": "Proper Noun", "remarks": "A sentient pancake monster created by Juri''s cooking during a crisis event. JA/KO translations are contextual (''Pancake-chan'')."}');
