-- Remis Main DB Seed Data
BEGIN TRANSACTION;

-- Schema for glossaries
CREATE TABLE glossaries (
        glossary_id INTEGER PRIMARY KEY AUTOINCREMENT,
        game_id TEXT NOT NULL,
        name TEXT NOT NULL,
        description TEXT,
        version TEXT,
        is_main INTEGER NOT NULL DEFAULT 0,
        sources TEXT,
        raw_metadata TEXT
    );
-- Data for glossaries

-- Schema for entries
CREATE TABLE entries (
        entry_id TEXT PRIMARY KEY,
        glossary_id INTEGER,
        translations TEXT NOT NULL,
        abbreviations TEXT,
        variants TEXT,
        raw_metadata TEXT,
        FOREIGN KEY (glossary_id) REFERENCES glossaries (glossary_id)
    );
-- Data for entries

COMMIT;
